  getlogs() {
    if (typeof window !== 'undefined' ? window.localStorage : null) {
      this.id = localStorage.getItem('userid')
      this.numOfDays = parseInt(localStorage.getItem('numOfDays'))

      this.trailuser = localStorage.getItem('trailuser')
      console.log(this.trailuser)
      if (this.trailuser == 'YES') {
        this.securityService.getTrailLogs(this.id).subscribe((result) => {
          this.TrailUserLogs = result
        })
      } else if (this.trailuser == 'NO') {
        this.securityService.getLogs(this.id).subscribe((result) => {
          this.customerLogs = result
        })
      }
    }
    if (this.numOfDays > 30) {
      document.getElementById('pwdReset').click()
    }
  }
